import React, { useEffect, useState } from 'react';
import './App.css'
import {
	BrowserRouter as Router,
	Route,
	Redirect,
	Switch
} from 'react-router-dom';
import { initWeb3, callContract } from './web3Client'
import Home from './pages/home'
import Product from './pages/product'


const App = () => {
	useEffect(() => {
		initWeb3()
		callContract().then(data => { console.log(data) }).catch(err => { console.log(err) })
	}, []);

	return (
		<Router>
			<Switch>
				<Redirect exact from="/" to="/home" />
				<Route exact path="/home" component={() => <Home></Home>}></Route>
				<Route exact path="/product" component={() => <Product></Product>}></Route>
			</Switch>
		</Router>
	)
}

export default App;
